  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is from a series of laboratory
  experiments examining the interactions between red and blue king crabs and habitat.
  \ We examined how density and predator presence affect habitat choice by red and
  blue king crabs.  Further experiments determined how temperature and habitat affect
  predation by year-1 red king crab on year-0 blue king crab.  Finally, long-term
  interaction experiments examined how habitat and density affected growth, survival,
  and intra-guild interactions between red and blue king crab.\",\n\t\"license_title\":
